import React from 'react';
import logo from './logo.svg';
import ReactDOM from 'react-dom';
import './App.css';
import {Helmet} from "react-helmet";
import ContentLoader from "react-content-loader"
class App extends React.Component {
  render()
  {
  return (
    <div>
    <ContentLoader
    height={560}
    width={100}
    speed={2}
    primaryColor="#f3f3f3"
    secondaryColor="#ecebeb"
  >
    <rect x="3" y="2" rx="0" ry="0" width="13" height="14" />
    <rect x="18" y="2" rx="0" ry="0" width="13" height="14" />
    <rect x="33" y="2" rx="0" ry="0" width="13" height="14" />
    <rect x="48" y="2" rx="0" ry="0" width="13" height="14" />
    <rect x="63" y="2" rx="0" ry="0" width="13" height="14" />
    <rect x="78" y="2" rx="0" ry="0" width="13" height="14" />
    <rect x="33" y="2" rx="0" ry="0" width="13" height="14" />
    <rect x="48" y="2" rx="0" ry="0" width="13" height="14" />
  </ContentLoader>

  </div>
  );
}
}
export default App;
